import React from 'react';

interface MyProps {}

interface MyState {
    nama: string;
    kelas: string;
    pagiSiang: string;
}

class Root extends React.Component <{}, MyState>  {
    constructor({}) {
        super({});

        this.state = {
            nama: "JOJO",
            kelas: "XI MIPA 2",
            pagiSiang: "true"
        };
    }

    render() {
        return (
            <div>
                <h1>Nama : {this.state.nama}</h1>
                <h2>Kelas : {this.state.kelas}</h2>
                <h3>Pagisiang : {this.state.pagiSiang}</h3>
            </div>
        )
    }
}
export default Root;
